import React from 'react';
import SearchBar from './SearchBar';

const App = () => {

    function onTermSubmit(term) {
        console.log(term);
    };
    return(
        <div className="ui container">
            <SearchBar onFormSubmit={()=>onTermSubmit} />
        </div>
    );
}
export default App;
